{-# OPTIONS_GHC -Wall #-}
module DatabaseDesign.Ampersand_Prototype.ObjBinGen  (phpObjServices)
  where
 
   import DatabaseDesign.Ampersand_Prototype.ConnectToDataBase   (connectToDataBase)
   import DatabaseDesign.Ampersand_Prototype.Object              (objectServices)
   import DatabaseDesign.Ampersand_Prototype.Wrapper             (objectWrapper)
   import DatabaseDesign.Ampersand_Prototype.Installer           (installer)
   import DatabaseDesign.Ampersand_Prototype.InterfaceDef        (interfaceDef)
   import DatabaseDesign.Ampersand_Prototype.Index               (htmlindex)
   import DatabaseDesign.Ampersand_Prototype.RelBinGenBasics     (addSlashes)
   import DatabaseDesign.Ampersand_Prototype.ContextGen          (contextGen)
   --import DatabaseDesign.Ampersand_Prototype.DataObject          (dataServices)
   import System.FilePath               
   import System.Directory
   import qualified Data.ByteString as Bin
   import DatabaseDesign.Ampersand  
   import Prelude hiding (writeFile,readFile,getContents,putStr,putStrLn)
   
   phpObjServices :: Fspc -> Options -> IO()
   phpObjServices fSpec flags
     = writeStaticFiles flags
      >> verboseLn flags "---------------------------"
      >> verboseLn flags "Generating php Object files with Ampersand"
      >> verboseLn flags "---------------------------"
      >> write "index.htm"                 (htmlindex fSpec svcs flags)
      >> write "Installer.php"             (installer fSpec flags)
      >> write (name fSpec++".php")        (contextGen fSpec)
      >> write "interfaceDef.inc.php"      (interfaceDef fSpec svcs flags)
      >> write "connectToDataBase.inc.php" (connectToDataBase fSpec flags)
      >> verboseLn flags ("  Writing username and password: dbsettings.php")
      >> writeFile (combine targetDir "dbsettings.php") dbsettings
      >> verboseLn flags ("Includable files for all objects:")
      >> sequence_
         [ write (addExtension (name svc) ".inc.php") (objectServices flags fSpec (svObj svc))
         | svc <- svcs
         ]
      >> verboseLn flags ("Wrapper files for all objects:")
      >> sequence_
         [ write (addExtension (name svc) ".php") (objectWrapper fSpec svcs svc flags)
         | svc <- svcs
         ]
      >> verboseLn flags ("\n")
      where
       write fname content
          =   verboseLn flags ("  Generating "++fname)
           >> writeFile (combine targetDir fname) content
       dbsettings = "<?php $DB_link=mysql_connect("
                    ++  "$DB_host='"++addSlashes (sqlHost flags)++"'"
                    ++", $DB_user='"++addSlashes (sqlLogin flags)++"'"
                    ++", $DB_pass='"++addSlashes (sqlPwd flags)++"'"
                    ++") or exit(\"Username / password are probably incorrect.\"); $DB_debug = 3; ?>"
       targetDir = dirPrototype flags
       svcs = serviceS fSpec++ serviceG fSpec--Was (voor ontvlechting): map fsv_svcdef (fServices fSpec)

   data StaticFile = SF { relFP         :: [FilePath] -- relative path including basename and extension
                        , isBinary      :: Bool
                        , contentString :: String
                        }
                     
   writeIfMissing :: Options -> StaticFile -> IO()
   writeIfMissing flags sf 
      = do exists <- doesFileExist (absFilePath flags sf) 
           if exists 
             then verboseLn flags ( "  Skipping "++absFilePath flags sf++", because it already exists.")
             else 
                ( sequence_(
                      [ verboseLn flags ("  Writing static file "++ absFilePath flags sf)]
                   ++ [ createDirectoryIfMissing True (takeDirectory (absFilePath flags sf))]
                   ++ [ write (absFilePath flags sf) (contentString sf) ]
                ))
                 
         where write a b = case isBinary sf of
                             True  -> Bin.writeFile a (toBin b)
                             False ->     writeFile a b
               toBin :: String -> Bin.ByteString
               toBin x = read x

   absFilePath :: Options -> StaticFile -> FilePath
   absFilePath flags sf = (dirPrototype flags) </> joinPath (relFP sf)


   writeStaticFiles :: Options -> IO()
   writeStaticFiles flags =  mapM_ (writeIfMissing flags) allStaticFiles

   allStaticFiles :: [StaticFile]
   allStaticFiles 
