       , SF ["css","screen.css"]               False  "/* Standard Elements */\n\nbody { font-family: Arial, Helvetica, sans-serif; font-size: 13px; color: #333333; line-height: 150%; }\na, a:link { color: #1A9AEA; }\na, a:link, a:hover, a:visited { text-decoration: none; }\na:hover { color: #BF1E74; }\n\nh1 { font-size: 24px; color: #BF1E74; font-weight: bold; line-height: 120%; padding-bottom: 10px; }\nh2, .FloaterHeader { font-size: 18px; color: #253E8A; font-weight: bold; line-height: 120%; }\n\n/* Lay-out */\n\n#container { width: 100%; margin: 0 auto; }\n#container #header { float: left; width: 100%; height: 116px; background: white; }\n#container #header #logo { float: left; display: block; padding: 30px 0 0 20px; }\n#container #header #decoration { float: right; display: block; height: 116px; width: 709px; background: url(../images/header_decoration.jpg) no-repeat; }\n\n#container #menu .primairy { float: left; width: 100%; height: 100%; background: #333333 url(../images/menu_bg.jpg) repeat-x bottom center; }\n#container #menu .primairy ul li a { float: left; display: block; height: 22px; padding: 8px 20px 0 20px; font-size: 16px; color: white; font-weight: bold; }\n#container #menu .primairy ul li a:hover { background: white; color: #BF1E74; }\n#container #menu .primairy ul li a.right { float: right; }\n\n#container #content { clear: both; float: left; padding: 20px; }\n#container #content .Floater { float: left; margin-right: 20px; margin-bottom: 20px; padding: 20px; -moz-border-radius: 5px; border: 1px solid #CDD8DE; }\n#container #content .Floater .FloaterHeader { padding-bottom: 10px; }\n#container #content .Floater .FloaterContent a.GotoLink { border-bottom: 1px dotted #1A9AEA; cursor: pointer; }\n#container #content .Floater .FloaterContent a.GotoLink:hover { border-bottom: 1px dotted #BF1E74; }\n#container #content .Floater .FloaterContent div.Goto { display: none; position: absolute; margin-left: 10px; padding: 10px; -moz-border-radius: 5px; border: